import React from 'react';
import { BrowserRouter as Router, Link } from "react-router-dom";
import './Navbar.css';
import logo from './assets/logo.png';
import Disclosure_Document from './assets/Disclosure_Document_26Dec19.pdf';

 function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-white">
        <Link className="navbar-brand ml-5 pl-5" to="/"><img className="logo-img" src={logo} alt="logo" style={{width:"175px"}}/></Link>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse " id="navbarSupportedContent">
            <ul className="navbar-nav ml-auto pr-5 mr-5">
            <li className="nav-item">
                <Link className="nav-link text-dark pr-4" to="/" aria-disabled="true">Approach</Link>

            </li>

            <li className="nav-item">
                <Link className="nav-link text-dark pr-4" to="#" tabIndex="-1" aria-disabled="true">Team</Link>

            </li>

            <li className="nav-item">
                <Link className="nav-link text-dark pr-4" to={Disclosure_Document} target="_blank" tabIndex="-2" aria-disabled="true">Disclaimer Document</Link>
            </li>

            <li className="nav-item">
            <Link className="get-started" to="/GetStarted" aria-disabled="true"><button className="get-started">Get Started</button></Link>

            </li>
            </ul>

        </div>
    </nav>
  );
}

export default Navbar;
